export function stringifyPayload(payload: Record<string, any>) {
  return Object.entries(payload)
    .map(([key, value]) => {
      return `${encodeURIComponent(key)}=${encodeURIComponent(
        typeof value === "object" ? JSON.stringify(value) : value,
      )}`;
    })
    .join("&");
}

